(168859, 'C8B923D6-EE55-4AC0-93F9-952697B36B99', 'Somehow, Brain pickings finds its way into my in box at just  the right time. She does this beautiful review of the new book by Patti Smith.  https://www.brainpickings.org/2015/10/19/patti-smith-m-train-loss-time/?mc_cid=c5fc5a144d&mc_eid=1469ae03e9  This passage sums up the feeling of sadness I was sharing with you: ''We want things we cannot have. We seek to reclaim a certain moment, sound, sensation. I want to hear my mother’s voice. I want to see my children as children. Hands small, feet swift. Everything changes. Boy grown, father dead, daughter taller than me, weeping from a bad dream. Please stay forever, I say to the things I know. Don’t go. Don’t grow.'' And this a piece of advice I want to share with Nathan:  If we walk the victim, we’re perceived as the victim. And if we enter ... glowing and receptive ... if we maintain our radiance and enter a situation with radiance, often radiance will come our way.  when you were saying how you wanted to continue to share thoughts and ideas and be intellectually challenged with me, as I do with you....I was trying to express that I also want to share this side of the intellectual/emotional experience...writings, music and art by people like Patti Smith and Laurie Anderson and Lou Reed, George Clinton and new ones like Joanna Newsom, New Order, Elvis Costello, D''angelo and Kendrick LaMar. This stuff is vital to me for so many reasons. I know much of this is new to you and some doesn''t immediately resonate, I hope you will be curious and open yourself to be challenged as you  challenge me on other fronts. It is worth it.I feel you are such a wonderful guide for me, and love and appreciate you beyond measure. I can be a bit of a guide for you here...and it is as important to the richness as life and the life I want to share with you as the ideas and podcasts and other types of learning.  When you said you wanted to learn by listening to podcasts on your run ...and I said I learn by listening to music.  Guess what???? both can be true.   ', 'David', 'Nitzan', '2015-10-25T09:19:57'),
