(168723, '1143E18E-57D4-4F29-B9DD-0A31D52A0BDC', 'Morning love. Hope you are still sleeping. I know you were sleeping as you rivaled me in the snoring dept.  try not to psych yourself out. This pitch will evolve countless times and the core is solid. Think of you are able to more clearly communicate the experience of being a ReUp student (using storytelling and a few thoughtful examples of how the various services can be utilized across the journey) you will be in good shape. This will make the value of data/tech, intelligent coaching and  ''piecing it together'' real. Right now it is not clear what you mean by some of the features in a way that communicates the thoughtfulness behind the words. I''ll wake you up now with my work in progress...my first little love song to you. I often start this way...recording a few tracks of the first few parts and then build it....hopefully not adding too much and mucking up. I''m excited about the direction (and the sound of my new equipment).  https://soundcloud.com/nwdave/honeymoon-days-v1 ', 'David', 'Nitzan', '2015-10-26T06:22:09'),
